import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './components/Login';
import Content from './components/Content'; // Replace with your content component

const App = () => {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Login />
        </Route>
        <Route path="/content">
          <Content />
        </Route>
      </Switch>
    </Router>
  );
};

export default App;
